import { useState } from "react";
import Modal from "./Modal";

const ModalCaller = () => {
  const [openModal, setOpenModal] = useState(false);

  const clickOpenModalHandler = () => {
    setOpenModal(true);
  };

  return (
    <div>
      <button onClick={clickOpenModalHandler}>Open Modal</button>
    </div>
  );
};

export default ModalCaller;
